import React from 'react';


const FirstYear = () => {
    return (
        <div className="containerabout-page">
            <h1>About Me</h1>
            <p>My name is Karymbaev Nurlan. i'm Salymbekov University 2-year student, and i made this react website-portfolio to show my works</p>

            <section className="team">
                <h2>my Skills and Achievements</h2>
                <p>I know Russian and English</p>
                <p>I can do Designs for my works</p>
                <p>I Did Couple of Projects</p>
               
            </section>
        </div>
    );
};

export default FirstYear;
